DROP TABLE IF EXISTS "public"."spatial_info";
CREATE TABLE "public"."spatial_info" (
  "gid" int4 NOT NULL,
  "name" varchar(30) COLLATE "pg_catalog"."default" NOT NULL,
  "pinyin" varchar(50) COLLATE "pg_catalog"."default" NOT NULL,
  "introduction" varchar(255) COLLATE "pg_catalog"."default",
  "image" varchar(255) COLLATE "pg_catalog"."default",
  "geom" "public"."geometry" NOT NULL
)
;
ALTER TABLE "public"."spatial_info" OWNER TO "postgres";

BEGIN;
COMMIT;

DROP TABLE IF EXISTS "public"."user";
CREATE TABLE "public"."user" (
  "username" varchar(20) COLLATE "pg_catalog"."default" NOT NULL,
  "password" varchar(32) COLLATE "pg_catalog"."default" NOT NULL,
  "salt" varchar(10) COLLATE "pg_catalog"."default" NOT NULL
)
;
ALTER TABLE "public"."user" OWNER TO "root";

BEGIN;
COMMIT;

ALTER TABLE "public"."spatial_info" ADD PRIMARY KEY ("gid");
ALTER TABLE "public"."user" ADD PRIMARY KEY ("username");
